A arte abstrata ou abstracionismo é geralmente entendido como uma forma de arte (especialmente nas artes visuais) que não representa objetos próprios da nossa realidade concreta exterior. Ao invés disso, usa as relações formais entre cores, linhas e superfícies para compor a realidade da obra, de uma maneira "não representacional". Surge a partir das experiências das vanguardas europeias, que recusam a herança renascentista das academias de arte, em outras palavras, a estética greco-romana. A expressão também pode ser usada para se referir especificamente à arte produzida no início do século XX por determinados movimentos e escolas que genericamente encaixam-se na arte moderna. No início do século XX, antes que os artistas atingissem a abstração absoluta, o termo também foi usado para se referir a escolas como o cubismo e o futurismo que, ainda que fossem representativas e figurativas, buscavam sintetizar os elementos da realidade natural, resultando em obras que fugiam à simples imitação daquilo que era "concreto". O abstracionismo divide-se em duas tendências: 
* Abstracionismo lírico, expressivo ou informal; 
* Abstracionismo geométrico.
